import {AppBar,Toolbar,styled} from '@mui/material';

const Header=styled(AppBar)`
background:#111111
`
const Tabs=styled('p')`
  font-size: 20px
`

const NavBar=()=>{
    return(
       <Header>
        <Toolbar>
           <Tabs>Code for Interview</Tabs>
           <Tabs>AllUser</Tabs>
           <Tabs>Adduser</Tabs>
        </Toolbar>
       </Header>
    )
}

export default NavBar;
